import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 54.1-4421 Biennial report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-4421.md","filePath":"vacode/54.1-4421.md"}'),t={name:"vacode/54.1-4421.md"},n=i('<h1 id="§-54-1-4421-biennial-report" tabindex="-1">§ 54.1-4421 Biennial report. <a class="header-anchor" href="#§-54-1-4421-biennial-report" aria-label="Permalink to &quot;§ 54.1-4421 Biennial report.&quot;">​</a></h1><p>The Board shall submit a biennial report to the Governor and General Assembly on or before November 1 of each even-numbered year. The biennial report shall contain, at a minimum, the following information: (i) a description of the Board&#39;s activities, (ii) a report on the audit of the Board&#39;s financial statements for the biennium, (iii) statistical information regarding the administrative hearings and decisions of the Board, and (iv) a general summary of all complaints received against persons and firms and the procedures used to resolve the complaints.</p><p>2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0832" target="_blank" rel="noreferrer">832</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0650" target="_blank" rel="noreferrer">650</a>; 2007, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0804" target="_blank" rel="noreferrer">804</a>.</p>',3),o=[n];function s(l,c,d,p,h,_){return a(),r("div",null,o)}const g=e(t,[["render",s]]);export{m as __pageData,g as default};
